import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 18.2-152.8 Property capable of embezzlement.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-152.8.md","filePath":"vacode/18.2-152.8.md"}'),o={name:"vacode/18.2-152.8.md"},n=t('<h1 id="§-18-2-152-8-property-capable-of-embezzlement" tabindex="-1">§ 18.2-152.8 Property capable of embezzlement. <a class="header-anchor" href="#§-18-2-152-8-property-capable-of-embezzlement" aria-label="Permalink to &quot;§ 18.2-152.8 Property capable of embezzlement.&quot;">​</a></h1><p>For purposes of §§ <a href="http://law.lis.virginia.gov/vacode/18.2-95/" target="_blank" rel="noreferrer">18.2-95</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-96/" target="_blank" rel="noreferrer">18.2-96</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-108/" target="_blank" rel="noreferrer">18.2-108</a>, and <a href="http://law.lis.virginia.gov/vacode/18.2-111/" target="_blank" rel="noreferrer">18.2-111</a>, personal property subject to embezzlement, larceny, or receiving stolen goods shall include:</p><ol><li><p>Computers and computer networks;</p></li><li><p>Financial instruments, computer data, computer programs, computer software and all other personal property regardless of whether they are:</p></li></ol><p>a. Tangible or intangible;</p><p>b. In a format readable by humans or by a computer;</p><p>c. In transit between computers or within a computer network or between any devices which comprise a computer; or</p><p>d. Located on any paper or in any device on which it is stored by a computer or by a human; and</p><ol start="3"><li>Computer services.</li></ol><p>1984, c. 751; 2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0746" target="_blank" rel="noreferrer">746</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0761" target="_blank" rel="noreferrer">761</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0827" target="_blank" rel="noreferrer">827</a>.</p>',9),l=[n];function i(p,c,s,m,d,h){return r(),a("div",null,l)}const b=e(o,[["render",i]]);export{f as __pageData,b as default};
